window.bookSummaryJSON = "<p>Nothing about being a librarian prepared Thuy Nguyen for such a wide variety of casseroles. Or life in a small town. Or becoming a farmer.</p> <p>But what can she do when her catastrophe-prone best friend begs her for help? After all, Maddy has always been there for Thuy. It’s time to return the favor.</p> <p>It’s simple really, all she has to do is: Learn everything about farming ASAP, save her BBF’s family business from disaster, and avoid being caught staring at Maddy’s biker brother, and his muscles, and his smile, and his soulful, sexy eyes.</p> <p>Oh yeah, and she should definitely not fall in love with him.</p> <p>Easy, right?...Right.</p> <p><i>Prose Before Bros</i> is a full-length contemporary romantic comedy, can be listened to as a standalone, and is book number three in the Green Valley Library series, Green Valley World, Penny Reid Book Universe<i>.</i></p>"; 
